pan><span class=\"pun\">:</span><span class=\"pln\"> </span><span class=\"lit\">60</span><span class=\"pun\">%;</span><span class=\"atv\">\"</span><span class=\"tag\">&gt;&lt;/div&gt;</span></li><li class=\"L2\"><span class=\"tag\">&lt;/div&gt;</span></li></ol></pre>\r\n\r\n          <h3>Striped</h3>\r\n          <p>Uses a gradient to create a striped effect. Not available in IE7-8.</p>\r\n          <div class=\"bs-docs-example\">\r\n            <div class=\"progress progress-striped\">\r\n              <div class=\"bar\" style=\"width: 20%;\"></div>\r\n            </div>\r\n          </div>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"progress progress-striped\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  </span><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"bar\"</span><span class=\"pln\"> </span><span class=\"atn\">style</span><span class=\"pun\">=</span><span class=\"atv\">\"</span><span class=\"pln\">width</span><span class=\"pun\">:</span><span class=\"pln\"> </span><span class=\"lit\">20</span><span class=\"pun\">%;</span><span class=\"atv\">\"</span><span class=\"tag\">&gt;&lt;/div&gt;</span></li><li class=\"L2\"><span class=\"tag\">&lt;/div&gt;</span></li></ol></pre>\r\n\r\n          <h3>Animated</h3>\r\n          <p>Add <code>.active</code> to <code>.progress-striped</code> to animate the stripes right to left. Not available in all versions of IE.</p>\r\n          <div class=\"bs-docs-example\">\r\n            <div class=\"progress progress-striped active\">\r\n              <div class=\"bar\" style=\"width: 45%\"></div>\r\n            </div>\r\n          </div>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span clas