/a></li>\r\n                <li><a href=\"#\">1</a></li>\r\n                <li><a href=\"#\">2</a></li>\r\n                <li><a href=\"#\">3</a></li>\r\n                <li><a href=\"#\">4</a></li>\r\n                <li><a href=\"#\">5</a></li>\r\n                <li><a href=\"#\">»</a></li>\r\n              </ul>\r\n            </div>\r\n          </div>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"pagination pagination-large\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  </span><span class=\"tag\">&lt;ul&gt;</span></li><li class=\"L2\"><span class=\"pln\">    ...</span></li><li class=\"L3\"><span class=\"pln\">  </span><span class=\"tag\">&lt;/ul&gt;</span></li><li class=\"L4\"><span class=\"tag\">&lt;/div&gt;</span></li><li class=\"L5\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"pagination\"</span><span class=\"tag\">&gt;</span></li><li class=\"L6\"><span class=\"pln\">  </span><span class=\"tag\">&lt;ul&gt;</span></li><li class=\"L7\"><span class=\"pln\">    ...</span></li><li class=\"L8\"><span class=\"pln\">  </span><span class=\"tag\">&lt;/ul&gt;</span></li><li class=\"L9\"><span class=\"tag\">&lt;/div&gt;</span></li><li class=\"L0\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"pagination pagination-small\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  </span><span class=\"tag\">&lt;ul&gt;</span></li><li class=\"L2\"><span class=\"pln\">    ...</span></li><li class=\"L3\"><span class=\"pln\">  </span><span class=\"tag\">&lt;/ul&gt;</span></li><li class=\"L4\"><span class=\"tag\">&lt;/div&gt;</span></li><li class=\"L5\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"pagination pagination-mini\"</span><span class=\"tag\">&gt;</span></li><li class=\"L6\"><span class=\"pln\">  </span><span class=\"tag\">&lt;ul&gt;</span></li><li class=\"L7\"><span class=\"pln\">    ...</span></li><li class=\"L8\"><span class=\"pln\">  </span><span class=\"tag\">&lt;/ul&gt;</span></li><li class=\"L9\"><span class=\"tag\">&lt;/div&gt;</span></li></ol></pre>\r\n\r\n          <h3>Alignment</h3>\r\n          <p>Add one of two optional classes to change the alignment of pagination links: <code>.pagination-centered</code> and <code>.pagination-right</code>.</p>\r\n          <div class=\"bs-docs-example\">\r\n            <div class=\"pagination pagination-centered\">\r\n              <ul>\r\n                <li><a href=\"#\">«</a></li>\r\n                <li><a href=\"#\">1</a></li>\r\n                <li><a href=\"#\">2</a></li>\r\n                <li><a href=\"#\">3</a></li>\r\n                <li><a href=\"#\">4</a></li>\r\n                <li><a href=\"#\">5</a></li>\r\n                <li><a href=\"#\">»</a></li>\r\n             </ul>\r\n            </div>\r\n          </div>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"pagination pagination-centered\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  ...</span></li><li class=\"L2\"><span class=\"tag\">&lt;/div&gt;</span></li></ol></pre>\r\n          <div class=\"bs-docs-example\">\r\n            <div class=\"pagination pagination-right\">\r\n              <ul>\r\n                <li><a href=\"#\">«</a></li>\r\n                <li><a href=\"#\">1</a></li>\r\n                <li><a href=\"#\">2</a></li>\r\n                <li><a href=\"#\">3</a></li>\r\n                <li><a href=\"#\">4</a></li>\r\n                <li><a href=\"#\">5</a></li>\r\n                <li><a href=\"#\">»</a></li>\r\n              </ul>\r\n            </div>\r\n          </div>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"pagination pagination-right\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  ...</span></li><li class=\"L2\"><span class=\"tag\">&lt;/div&gt;</span></li></ol></pre>\r\n\r\n\r\n          <hr class=\"bs-docs-separator\">\r\n\r\n\r\n          <h2>Pager</h2>\r\n          <p>Quick previous and next links for simple pagination implementations with light markup and styles. It\'s great for simple sites like blogs or magazines.</p>\r\n\r\n          <h3>Default example</h3>\r\n          <p>By default, the pager centers links.</p>\r\n          <div class=\"bs-docs-example\">\r\n            <ul class=\"pager\">\r\n              <li><a href=\"#\">Previous</a></li>\r\n              <li><a href=\"#\">Next</a></li>\r\n            </ul>\r\n          </div>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;ul</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"pager\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  </span><span class=\"tag\">&lt;li&gt;&lt;a</span><span class=\"pln\"> </span><span class=\"atn\">href</span><span class=\"pun\">=</span><span class=\"atv\">\"#\"</span><span class=\"tag\">&gt;</span><span class=\"pln\">Previous</span><span class=\"tag\">&lt;/a&gt;&lt;/li&gt;</span></li><li class=\"L2\"><span class=\"pln\">  </span><span class=\"tag\">&lt;li&gt;&lt;a</span><span class=\"pln\"> </span><span class=\"atn\">href</span><span class=\"pun\">=</span><span class=\"atv\">\"#\"</span><span class=\"tag\">&gt;</span><span class=\"pln\">Next</span><span class=\"tag\">&lt;/a&gt;&lt;/li&gt;</span></li><li class=\"L3\"><span class=\"tag\">&lt;/ul&gt;</span></li></ol></pre>\r\n\r\n          <h3>Aligned links</h3>\r\n          <p>Alternatively, you can align each link to the sides:</p>\r\n          <div class=\"bs-docs-example\">\r\n            <ul class=\"pager\">\r\n              <li class=\"previous\"><a href=\"#\">← Older</a></li>\r\n              <li class=\"next\"><a href=\"#\">Newer →</a></li>\r\n            </ul>\r\n          </div>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;ul</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"pager\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  </span><span class=\"tag\">&lt;li</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"previous\"</span><span class=\"tag\">&gt;</span></li><li class=\"L2\"><span class=\"pln\">    </span><span class=\"tag\">&lt;a</span><span class=\"pln\"> </span><span class=\"atn\">href</span><span class=\"pun\">=</span><span class=\"atv\">\"#\"</span><span class=\"tag\">&gt;</span><span class=\"pln\">&amp;larr; Older</span><span class=\"tag\">&lt;/a&gt;</span></li><li class=\"L3\"><span class=\"pln\">  </span><span class=\"tag\">&lt;/li&gt;</span></li><li class=\"L4\"><span class=\"pln\">  </span><span class=\"tag\">&lt;li</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"next\"</span><span class=\"tag\">&gt;</span></li><li class=\"L5\"><span class=\"pln\">    </span><span class=\"tag\">&lt;a</span><span class=\"pln\"> </span><span class=\"atn\">href</span><span class=\"pun\">=</span><span class=\"atv\">\"#\"</span><span class=\"tag\">&gt;</span><span class=\"pln\">Newer &amp;rarr;</span><span class=\"tag\">&lt;/a&gt;</span></li><li class=\"L6\"><span class=\"pln\">  </span><span class=\"tag\">&lt;/li&gt;</span></li><li class=\"L7\"><span class=\"tag\">&lt;/ul&gt;</span></li></ol></pre>\r\n\r\n          <h3>Optional disabled state</h3>\r\n          <p>Pager links also use the general <code>.disabled</code> utility class from the pagination.</p>\r\n          <div class=\"bs-docs-example\">\r\n            <ul class=\"pager\">\r\n              <li class=\"previous disabled\"><a href=\"#\">← Older</a></li>\r\n              <li class=\"next\"><a href=\"#\">Newer →</a></li>\r\n            </ul>\r\n          </div>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;ul</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"pager\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  </span><span class=\"tag\">&lt;li</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"previous disabled\"</span><span class=\"tag\">&gt;</span></li><li class=\"L2\"><span class=\"pln\">    </span><span class=\"tag\">&lt;a</span><span class=\"pln\"> </span><span class=\"atn\">href</span><span class=\"pun\">=</span><span class=\"atv\">\"#\"</span><span class=\"tag\">&gt;</span><span class=\"pln\">&amp;larr; Older</span><span class=\"tag\">&lt;/a&gt;</span></li><li class=\"L3\"><span class=\"pln\">  </span><span class=\"tag\">&lt;/li&gt;</span></li><li class=\"L4\"><span class=\"pln\">  ...</span></li><li class=\"L5\"><span class=\"tag\">&lt;/ul&gt;</span></li></ol></pre>','','full_html'),('node','page',0,61,61,'und',0,'          <table class=\"table table-bordered table-striped\">\r\n            <thead>\r\n              <tr>\r\n                <th>Labels</th>\r\n                <th>Markup</th>\r\n              </tr>\r\n            </thead>\r\n            <tbody>\r\n              <tr>\r\n                <td>\r\n                  <span class=\"label\">Default</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"label\"&gt;Default&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>\r\n                  <span class=\"label label-success\">Success</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"label label-success\"&gt;Success&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>\r\n                  <span class=\"label label-warning\">Warning</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"label label-warning\"&gt;Warning&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>\r\n                  <span class=\"label label-important\">Important</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"label label-important\"&gt;Important&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>\r\n                  <span class=\"label label-info\">Info</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"label label-info\"&gt;Info&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>\r\n                  <span class=\"label label-inverse\">Inverse</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"label label-inverse\"&gt;Inverse&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n            </tbody>\r\n          </table>\r\n\r\n          <h3>Badges</h3>\r\n          <table class=\"table table-bordered table-striped\">\r\n            <thead>\r\n              <tr>\r\n                <th>Name</th>\r\n                <th>Example</th>\r\n                <th>Markup</th>\r\n              </tr>\r\n            </thead>\r\n            <tbody>\r\n              <tr>\r\n                <td>\r\n                  Default\r\n                </td>\r\n                <td>\r\n                  <span class=\"badge\">1</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"badge\"&gt;1&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>\r\n                  Success\r\n                </td>\r\n                <td>\r\n                  <span class=\"badge badge-success\">2</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"badge badge-success\"&gt;2&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>\r\n                  Warning\r\n                </td>\r\n                <td>\r\n                  <span class=\"badge badge-warning\">4</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"badge badge-warning\"&gt;4&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>\r\n                  Important\r\n                </td>\r\n                <td>\r\n                  <span class=\"badge badge-important\">6</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"badge badge-important\"&gt;6&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>\r\n                  Info\r\n                </td>\r\n                <td>\r\n                  <span class=\"badge badge-info\">8</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"badge badge-info\"&gt;8&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>\r\n                  Inverse\r\n                </td>\r\n                <td>\r\n                  <span class=\"badge badge-inverse\">10</span>\r\n                </td>\r\n                <td>\r\n                  <code>&lt;span class=\"badge badge-inverse\"&gt;10&lt;/span&gt;</code>\r\n                </td>\r\n              </tr>\r\n            </tbody>\r\n          </table>\r\n\r\n          <h3>Easily collapsible</h3>\r\n          <p>For easy implementation, labels and badges will simply collapse (via CSS\'s <code>:empty</code> selector) when no content exists within.</p>','','full_html'),('node','page',0,62,62,'und',0,'          <h2>Examples</h2>\r\n          <p>Inspired by the excellent jQuery.tipsy plugin written by Jason Frame; Tooltips are an updated version, which don\'t rely on images, use CSS3 for animations, and data-attributes for local title storage.</p>\r\n          <p>For performance reasons, the tooltip and popover data-apis are opt in, meaning <strong>you must initialize them yourself</strong>.</p>\r\n          <p>Hover over the links below to see tooltips:</p>\r\n          <div class=\"bs-docs-example tooltip-demo\">\r\n            <p class=\"muted\" style=\"margin-bottom: 0;\">Tight pants next level keffiyeh <a href=\"#\" data-toggle=\"tooltip\" title=\"\" data-original-title=\"Default tooltip\">you probably</a> haven\'t heard of them. Photo booth beard raw denim letterpress vegan messenger bag stumptown. Farm-to-table seitan, mcsweeney\'s fixie sustainable quinoa 8-bit american apparel <a href=\"#\" data-toggle=\"tooltip\" title=\"Another tooltip\">have a</a> terry richardson vinyl chambray. Beard stumptown, cardigans banh mi lomo thundercats. Tofu biodiesel williamsburg marfa, four loko mcsweeney\'s cleanse vegan chambray. A really ironic artisan <a href=\"#\" data-toggle=\"tooltip\" title=\"A much longer tooltip belongs right here to demonstrate the max-width we apply.\">whatever keytar</a>, scenester farm-to-table banksy Austin <a href=\"#\" data-toggle=\"tooltip\" title=\"The last tip!\">twitter handle</a> freegan cred raw denim single-origin coffee viral.\r\n            </p>\r\n          </div>\r\n\r\n          <h3>Four directions</h3>\r\n          <div class=\"bs-docs-example tooltip-demo\">\r\n            <ul class=\"bs-docs-tooltip-examples\">\r\n              <li><a href=\"#\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"Tooltip on top\">Tooltip on top</a></li>\r\n              <li><a href=\"#\" data-toggle=\"tooltip\" data-placement=\"right\" title=\"Tooltip on right\">Tooltip on right</a></li>\r\n              <li><a href=\"#\" data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"Tooltip on bottom\">Tooltip on bottom</a></li>\r\n              <li><a href=\"#\" data-toggle=\"tooltip\" data-placement=\"left\" title=\"Tooltip on left\">Tooltip on left</a></li>\r\n            </ul>\r\n          </div>\r\n\r\n\r\n          <h3>Tooltips in input groups</h3>\r\n          <p>When using tooltips and popovers with the Bootstrap input groups, you\'ll have to set the <code>container</code> (documented below) option to avoid unwanted side effects.</p>\r\n\r\n          <hr class=\"bs-docs-separator\">\r\n\r\n\r\n          <h2>Usage</h2>\r\n          <p>Trigger the tooltip via JavaScript:</p>\r\n          <pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"pln\">$</span><span class=\"pun\">(</span><span class=\"str\">\'#example\'</span><span class=\"pun\">).</span><span class=\"pln\">tooltip</span><span class=\"pun\">(</span><span class=\"pln\">options</span><span class=\"pun\">)</span></li></ol></pre>\r\n\r\n          <h3>Options</h3>\r\n          <p>Options can be passed via data attributes or JavaScript. For data attributes, append the option name to <code>data-</code>, as in <code>data-animation=\"\"</code>.</p>\r\n          <table class=\"table table-bordered table-striped\">\r\n            <thead>\r\n             <tr>\r\n               <th style=\"width: 100px;\">Name</th>\r\n               <th style=\"width: 100px;\">type</th>\r\n               <th style=\"width: 50px;\">default</th>\r\n               <th>description</th>\r\n             </tr>\r\n            </thead>\r\n            <tbody>\r\n             <tr>\r\n               <td>animation</td>\r\n               <td>boolean</td>\r\n               <td>true</td>\r\n               <td>apply a css fade transition to the tooltip</td>\r\n             </tr>\r\n             <tr>\r\n               <td>html</td>\r\n               <td>boolean</td>\r\n               <td>false</td>\r\n               <td>Insert html into the tooltip. If false, jquery\'s <code>text</code> method will be used to insert content into the dom. Use text if you\'re worried about XSS attacks.</td>\r\n             </tr>\r\n             <tr>\r\n               <td>placement</td>\r\n               <td>string | function</td>\r\n               <td>\'top\'</td>\r\n               <td>how to position the tooltip - top | bottom | left | right</td>\r\n             </tr>\r\n             <tr>\r\n               <td>selector</td>\r\n               <td>string</td>\r\n               <td>false</td>\r\n               <td>If a selector is provided, tooltip objects will be delegated to the specified targets.</td>\r\n             </tr>\r\n             <tr>\r\n               <td>title</td>\r\n               <td>string | function</td>\r\n               <td>\'\'</td>\r\n               <td>default title value if `title` tag isn\'t present</td>\r\n             </tr>\r\n             <tr>\r\n               <td>trigger</td>\r\n               <td>string</td>\r\n               <td>\'hover focus\'</td>\r\n               <td>how tooltip is triggered - click | hover | focus | manual. Note you case pass trigger mutliple, space seperated, trigger types.</td>\r\n             </tr>\r\n             <tr>\r\n               <td>delay</td>\r\n               <td>number | object</td>\r\n               <td>0</td>\r\n               <td>\r\n                <p>delay showing and hiding the tooltip (ms) - does not apply to manual trigger type</p>\r\n                <p>If a number is supplied, delay is applied to both hide/show</p>\r\n                <p>Object structure is: <code>delay: { show: 500, hide: 100 }</code></p>\r\n               </td>\r\n             </tr>\r\n             <tr>\r\n               <td>container</td>\r\n               <td>string | false</td>\r\n               <td>false</td>\r\n               <td>\r\n                <p>Appends the tooltip to a specific element <code>container: \'body\'</code></p>\r\n               </td>\r\n             </tr>\r\n            </tbody>\r\n          </table>\r\n          <div class=\"alert alert-info\">\r\n            <strong>Heads up!</strong>\r\n            Options for individual tooltips can alternatively be specified through the use of data attributes.\r\n          </div>\r\n\r\n          <h3>Markup</h3>\r\n          <pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;a</span><span class=\"pln\"> </span><span class=\"atn\">href</span><span class=\"pun\">=</span><span class=\"atv\">\"#\"</span><span class=\"pln\"> </span><span class=\"atn\">data-toggle</span><span class=\"pun\">=</span><span class=\"atv\">\"tooltip\"</span><span class=\"pln\"> </span><span class=\"atn\">title</span><span class=\"pun\">=</span><span class=\"atv\">\"first tooltip\"</span><span class=\"tag\">&gt;</span><span class=\"pln\">hover over me</span><span class=\"tag\">&lt;/a&gt;</span></li></ol></pre>\r\n\r\n          <h3>Methods</h3>\r\n          <h4>$().tooltip(options)</h4>\r\n          <p>Attaches a tooltip handler to an element collection.</p>\r\n          <h4>.tooltip(\'show\')</h4>\r\n          <p>Reveals an element\'s tooltip.</p>\r\n          <pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"pln\">$</span><span class=\"pun\">(</span><span class=\"str\">\'#element\'</span><span class=\"pun\">).</span><span class=\"pln\">tooltip</span><span class=\"pun\">(</span><span class=\"str\">\'show\'</span><span class=\"pun\">)</span></li></ol></pre>\r\n          <h4>.tooltip(\'hide\')</h4>\r\n          <p>Hides an element\'s tooltip.</p>\r\n          <pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"pln\">$</span><span class=\"pun\">(</span><span class=\"str\">\'#element\'</span><span class=\"pun\">).</span><span class=\"pln\">tooltip</span><span class=\"pun\">(</span><span class=\"str\">\'hide\'</span><span class=\"pun\">)</span></li></ol></pre>\r\n          <h4>.tooltip(\'toggle\')</h4>\r\n          <p>Toggles an element\'s tooltip.</p>\r\n          <pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"pln\">$</span><span class=\"pun\">(</span><span class=\"str\">\'#element\'</span><span class=\"pun\">).</span><span class=\"pln\">tooltip</span><span class=\"pun\">(</span><span class=\"str\">\'toggle\'</span><span class=\"pun\">)</span></li></ol></pre>\r\n          <h4>.tooltip(\'destroy\')</h4>\r\n          <p>Hides and destroys an element\'s tooltip.</p>\r\n          <pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"pln\">$</span><span class=\"pun\">(</span><span class=\"str\">\'#element\'</span><span class=\"pun\">).</span><span class=\"pln\">tooltip</span><span class=\"pun\">(</span><span class=\"str\">\'destroy\'</span><span class=\"pun\">)</span></li></ol></pre>','','full_html'),('node','page',0,63,63,'und',0,' <h2>Examples</h2>\r\n        <p>Add small overlays of content, like those on the iPad, to any element for housing secondary information. Hover over the button to trigger the popover. <strong>Requires <a href=\"#tooltips\">Tooltip</a> to be included.</strong></p>\r\n\r\n        <h3>Static popover</h3>\r\n        <p>Four options are available: top, right, bottom, and left aligned.</p>\r\n        <div class=\"bs-docs-example bs-docs-example-popover\">\r\n          <div class=\"popover top\">\r\n            <div class=\"arrow\"></div>\r\n            <h3 class=\"popover-title\">Popover top</h3>\r\n            <div class=\"popover-content\">\r\n              <p>Sed posuere consectetur est at lobortis. Aenean eu leo quam. Pellentesque ornare sem lacinia quam venenatis vestibulum.</p>\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"popover right\">\r\n            <div class=\"arrow\"></div>\r\n            <h3 class=\"popover-title\">Popover right</h3>\r\n            <div class=\"popover-content\">\r\n              <p>Sed posuere consectetur est at lobortis. Aenean eu leo quam. Pellentesque ornare sem lacinia quam venenatis vestibulum.</p>\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"popover bottom\">\r\n            <div class=\"arrow\"></div>\r\n            <h3 class=\"popover-title\">Popover bottom</h3>\r\n            <div class=\"popover-content\">\r\n              <p>Sed posuere consectetur est at lobortis. Aenean eu leo quam. Pellentesque ornare sem lacinia quam venenatis vestibulum.</p>\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"popover left\">\r\n            <div class=\"arrow\"></div>\r\n            <h3 class=\"popover-title\">Popover left</h3>\r\n            <div class=\"popover-content\">\r\n              <p>Sed posuere consectetur est at lobortis. Aenean eu leo quam. Pellentesque ornare sem lacinia quam venenatis vestibulum.</p>\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"clearfix\"></div>\r\n        </div>\r\n        <p>No markup shown as popovers are generated from JavaScript and content within a <code>data</code> attribute.</p>\r\n\r\n        <h4>Four directions</h4>\r\n        <div class=\"bs-docs-example tooltip-demo\">\r\n          <ul class=\"bs-docs-tooltip-examples\">\r\n            <li><a href=\"#\" class=\"btn\" data-toggle=\"popover\" data-placement=\"top\" data-content=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\" title=\"\" data-original-title=\"Popover on top\">Popover on top</a></li>\r\n            <li><a href=\"#\" class=\"btn\" data-toggle=\"popover\" data-placement=\"right\" data-content=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\" title=\"\" data-original-title=\"Popover on right\">Popover on right</a></li>\r\n            <li><a href=\"#\" class=\"btn\" data-toggle=\"popover\" data-placement=\"bottom\" data-content=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\" title=\"\" data-original-title=\"Popover on bottom\">Popover on bottom</a></li>\r\n            <li><a href=\"#\" class=\"btn\" data-toggle=\"popover\" data-placement=\"left\" data-content=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\" title=\"\" data-original-title=\"Popover on left\">Popover on left</a></li>\r\n          </ul>\r\n        </div>\r\n\r\n\r\n        <hr class=\"bs-docs-separator\">\r\n\r\n\r\n        <h2>Usage</h2>\r\n        <p>Enable popovers via JavaScript:</p>\r\n        <pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"pln\">$</span><span class=\"pun\">(</span><span class=\"str\">\'#example\'</span><span class=\"pun\">).</span><span class=\"pln\">popover</span><span class=\"pun\">(</span><span class=\"pln\">options</span><span class=\"pun\">)</span></li></ol></pre>\r\n\r\n        <h3>Options</h3>\r\n        <p>Options can be passed via data attributes or JavaScript. For data attributes, append the option name to <code>data-</code>, as in <code>data-animation=\"\"</code>.</p>\r\n        <table class=\"table table-bordered table-striped\">\r\n          <thead>\r\n           <tr>\r\n             <th style=\"width: 100px;\">Name</th>\r\n             <th style=\"width: 100px;\">type</th>\r\n             <th style=\"width: 50px;\">default</th>\r\n             <th>description</th>\r\n           </tr>\r\n          </thead>\r\n          <tbody>\r\n           <tr>\r\n             <td>animation</td>\r\n             <td>boolean</td>\r\n             <td>true</td>\r\n             <td>apply a css fade transition to the tooltip</td>\r\n           </tr>\r\n           <tr>\r\n             <td>html</td>\r\n             <td>boolean</td>\r\n             <td>false</td>\r\n             <td>Insert html into the popover. If false, jquery\'s <code>text</code> method will be used to insert content into the dom. Use text if you\'re worried about XSS attacks.</td>\r\n           </tr>\r\n           <tr>\r\n             <td>placement</td>\r\n             <td>string | function</td>\r\n             <td>\'right\'</td>\r\n             <td>how to position the popover - top | bottom | left | right</td>\r\n           </tr>\r\n           <tr>\r\n             <td>selector</td>\r\n             <td>string</td>\r\n             <td>false</td>\r\n             <td>if a selector is provided, tooltip objects will be delegated to the specified targets</td>\r\n           </tr>\r\n           <tr>\r\n             <td>trigger</td>\r\n             <td>string</td>\r\n             <td>\'click\'</td>\r\n             <td>how popover is triggered - click | hover | focus | manual</td>\r\n           </tr>\r\n           <tr>\r\n             <td>title</td>\r\n             <td>string | function</td>\r\n             <td>\'\'</td>\r\n             <td>default title value if `title` attribute isn\'t present</td>\r\n           </tr>\r\n           <tr>\r\n             <td>content</td>\r\n             <td>string | function</td>\r\n             <td>\'\'</td>\r\n             <td>default content value if `data-content` attribute isn\'t present</td>\r\n           </tr>\r\n           <tr>\r\n             <td>delay</td>\r\n             <td>number | object</td>\r\n             <td>0</td>\r\n             <td>\r\n              <p>delay showing and hiding the popover (ms) - does not apply to manual trigger type</p>\r\n              <p>If a number is supplied, delay is applied to both hide/show</p>\r\n              <p>Object structure is: <code>delay: { show: 500, hide: 100 }</code></p>\r\n             </td>\r\n           </tr>\r\n           <tr>\r\n             <td>container</td>\r\n             <td>string | false</td>\r\n             <td>false</td>\r\n             <td>\r\n              <p>Appends the popover to a specific element <code>container: \'body\'</code></p>\r\n             </td>\r\n           </tr>\r\n          </tbody>\r\n        </table>\r\n        <div class=\"alert alert-info\">\r\n          <strong>Heads up!</strong>\r\n          Options for individual popovers can alternatively be specified through the use of data attributes.\r\n        </div>\r\n\r\n        <h3>Markup</h3>\r\n        <p>For performance reasons, the Tooltip and Popover data-apis are opt in. If you would like to use them just specify a selector option.</p>\r\n\r\n        <h3>Methods</h3>\r\n        <h4>$().popover(options)</h4>\r\n        <p>Initializes popovers for an element collection.</p>\r\n        <h4>.popover(\'show\')</h4>\r\n        <p>Reveals an elements popover.</p>\r\n        <pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"pln\">$</span><span class=\"pun\">(</span><span class=\"str\">\'#element\'</span><span class=\"pun\">).</span><span class=\"pln\">popover</span><span class=\"pun\">(</span><span class=\"str\">\'show\'</span><span class=\"pun\">)</span></li></ol></pre>\r\n        <h4>.popover(\'hide\')</h4>\r\n        <p>Hides an elements popover.</p>\r\n        <pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"pln\">$</span><span class=\"pun\">(</span><span class=\"str\">\'#element\'</span><span class=\"pun\">).</span><span class=\"pln\">popover</span><span class=\"pun\">(</span><span class=\"str\">\'hide\'</span><span class=\"pun\">)</span></li></ol></pre>\r\n        <h4>.popover(\'toggle\')</h4>\r\n        <p>Toggles an elements popover.</p>\r\n        <pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"pln\">$</span><span class=\"pun\">(</span><span class=\"str\">\'#element\'</span><span class=\"pun\">).</span><span class=\"pln\">popover</span><span class=\"pun\">(</span><span class=\"str\">\'toggle\'</span><span class=\"pun\">)</span></li></ol></pre>\r\n        <h4>.popover(\'destroy\')</h4>\r\n        <p>Hides and destroys an element\'s popover.</p>\r\n        <pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"pln\">$</span><span class=\"pun\">(</span><span class=\"str\">\'#element\'</span><span class=\"pun\">).</span><span class=\"pln\">popover</span><span class=\"pun\">(</span><span class=\"str\">\'destroy\'</span><span class=\"pun\">)</span></li></ol></pre>\r\n','','full_html');
