span><span class=\"lit\">35</span><span class=\"pun\">%;</span><span class=\"atv\">\"</span><span class=\"tag\">&gt;&lt;/div&gt;</span></li><li class=\"L2\"><span class=\"pln\">  </span><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"bar bar-warning\"</span><span class=\"pln\"> </span><span class=\"atn\">style</span><span class=\"pun\">=</span><span class=\"atv\">\"</span><span class=\"pln\">width</span><span class=\"pun\">:</span><span class=\"pln\"> </span><span class=\"lit\">20</span><span class=\"pun\">%;</span><span class=\"atv\">\"</span><span class=\"tag\">&gt;&lt;/div&gt;</span></li><li class=\"L3\"><span class=\"pln\">  </span><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"bar bar-danger\"</span><span class=\"pln\"> </span><span class=\"atn\">style</span><span class=\"pun\">=</span><span class=\"atv\">\"</span><span class=\"pln\">width</span><span class=\"pun\">:</span><span class=\"pln\"> </span><span class=\"lit\">10</span><span class=\"pun\">%;</span><span class=\"atv\">\"</span><span class=\"tag\">&gt;&lt;/div&gt;</span></li><li class=\"L4\"><span class=\"tag\">&lt;/div&gt;</span></li></ol></pre>\r\n\r\n\r\n          <hr class=\"bs-docs-separator\">\r\n\r\n\r\n          <h2>Options</h2>\r\n\r\n          <h3>Additional colors</h3>\r\n          <p>Progress bars use some of the same button and alert classes for consistent styles.</p>\r\n          <div class=\"bs-docs-example\">\r\n            <div class=\"progress progress-info\" style=\"margin-bottom: 9px;\">\r\n              <div class=\"bar\" style=\"width: 20%\"></div>\r\n            </div>\r\n            <div class=\"progress progress-success\" style=\"margin-bottom: 9px;\">\r\n              <div class=\"bar\" style=\"width: 40%\"></div>\r\n            </div>\r\n            <div class=\"progress progress-warning\" style=\"margin-bottom: 9px;\">\r\n              <div class=\"bar\" style=\"width: 60%\"></div>\r\n            </div>\r\n            <div class=\"progress progress-danger\">\r\n              <div class=\"bar\" style=\"width: 80%\"></div>\r\n            </div>\r\n          </div>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"progress progress-info\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  </span><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"bar\"</span><span class=\"pln\"> </span><span class=\"atn\">style</span><span class=\"pun\">=</span><span class=\"atv\">\"</span><span class=\"pln\">width</span><span class=\"pun\">:</span><span class=\"pln\"> </span><span class=\"lit\">20</span><span class=\"pun\">%</span><span class=\"atv\">\"</span><span class=\"tag\">&gt;&lt;/div&gt;</span></li><li class=\"L2\"><span class=\"tag\">&lt;/div&gt;</span></li><li class=\"L3\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"progress progress-success\"</span><span class=\"tag\">&gt;</span></li><li class=\"L4\"><span class=\"pln\">  </span><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"bar\"</span><span class=\"pln\"> </span><span class=\"atn\">style</span><span class=\"pun\">=</span><span class=\"atv\">\"</span><span class=\"pln\">width</span><span class=\"pun\">:</span><span class=\"pln\"> </span><span class=\"lit\">40</span><span class=\"pun\">%</span><span class=\"atv\">\"</span><span class=\"tag\">&gt;&lt;/div&gt;</span></li><li class=\"L5\"><span class=\"tag\">&lt;/div&gt;</spa