width: 20%\"></div>\r\n            </div>\r\n            <div class=\"progress progress-success progress-striped\" style=\"margin-bottom: 9px;\">\r\n              <div class=\"bar\" style=\"width: 40%\"></div>\r\n            </div>\r\n            <div class=\"progress progress-warning progress-striped\" style=\"margin-bottom: 9px;\">\r\n              <div class=\"bar\" style=\"width: 60%\"></div>\r\n            </div>\r\n            <div class=\"progress progress-danger progress-striped\">\r\n              <div class=\"bar\" style=\"width: 80%\"></div>\r\n            </div>\r\n          </div>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"progress progress-info progress-striped\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  </span><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"bar\"</span><span class=\"pln\"> </span><span class=\"atn\">style</span><span class=\"pun\">=</span><span class=\"atv\">\"</span><span class=\"pln\">width</span><span class=\"pun\">:</span><span class=\"pln\"> </span><span class=\"lit\">20</span><span class=\"pun\">%</span><span class=\"atv\">\"</span><span class=\"tag\">&gt;&lt;/div&gt;</span></li><li class=\"L2\"><span class=\"tag\">&lt;/div&gt;</span></li><li class=\"L3\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"progress progress-success progress-striped\"</span><span class=\"tag\">&gt;</span></li><li class=\"L4\"><span class=\"pln\">  </span><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"bar\"</span><span class=\"pln\"> </span><span class=\"atn\">style</span><span class=\"pun\">=</span><span class=\"atv\">\"</span><span class=\"pln\">width</span><span class=\"pun\">:</span><span class=\"pln\"> </span><span class=\"lit\">40</span><span class=\"pun\">%</span><span class=\"atv\">\"</span><span class=\"tag\">&gt;&lt;/div&gt;</span></li><li class=\"L5\"><span class=\"tag\">&lt;/div&gt;</span></li><li class=\"L6\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"progress progress-warning progress-striped\"</span><span class=\"tag\">&gt;</span></li><li class=\"L7\"><span class=\"pln\">  </span><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"bar\"</span><span class=\"pln\"> </span><span class=\"atn\">style</span><span class=\"pun\">=</span><span class=\"atv\">\"</span><span class=\"pln\">width</span><span class=\"pun\">:</span><span class=\"pln\"> </span><span class=\"lit\">60</span><span class=\"pun\">%</span><span class=\"atv\">\"</span><span class=\"tag\">&gt;&lt;/div&gt;</span></li><li class=\"L8\"><span class=\"tag\">&lt;/div&gt;</span></li><li class=\"L9\"><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"progress progress-danger progress-striped\"</span><span class=\"tag\">&gt;</span></li><li class=\"L0\"><span class=\"pln\">  </span><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"bar\"</span><span class=\"pln\"> </span><span class=\"atn\">style</span><span class=\"pun\">=</span><span class=\"atv\">\"</span><span class=\"pln\">width</span><span class=\"pun\">:</span><span class=\"pln\"> </span><span class=\"lit\">80</span><span class=\"pun\">%</span><span class=\"atv\">\"</span><span class=\"tag\">&gt;&lt;/div&gt;</span></li><li class=\"L1\"><span class=\"tag\">&lt;/div&gt;</span></li></ol></pre>','','full_html'),('node','page',0,58,58,'und',0,'          <h2>Default thumbnails</h2>\r\n          <p>By default, Bootstrap\'s thumbnails are designed to showcase linked images with minimal required markup.</p>\r\n          <div class=\"row-fluid\">\r\n            <ul class=\"thumbnails\">\r\n              <li class=\"span3\">\r\n                <a href=\"#\" class=\"thumbnail\"><img data-src=\"holder.js/260x180\" alt=\"260x180\" style=\"width: 260px; height: 180px;\" src=\"data:image/png;base64,\"></a>\r\n              </li>\r\n              <li class=\"span3\">\r\n                <a href=\"#\" class=\"thumbnail\"><img data-src=\"holder.js/260x180\" alt=\"260x180\" style=\"width: 260px; height: 180px;\" src=\"data:image/png;base64,\"></a>\r\n              </li>\r\n              <li class=\"span3\">\r\n                <a href=\"#\" class=\"thumbnail\"><img data-src=\"holder.js/260x180\" alt=\"260x180\" style=\"width: 260px; height: 180px;\" src=\"data:image/png;base64,\"></a>\r\n              </li>\r\n              <li class=\"span3\">\r\n                <a href=\"#\" class=\"thumbnail\"><img data-src=\"holder.js/260x180\" alt=\"260x180\" style=\"width: 260px; height: 180px;\" src=\"data:image/png;base64,\"></a>\r\n              </li>\r\n            </ul>\r\n          </div>\r\n\r\n          <h2>Highly customizable</h2>\r\n          <p>With a bit of extra markup, it\'s possible to add any kind of HTML content like headings, paragraphs, or buttons into thumbnails.</p>\r\n          <div class=\"row-fluid\">\r\n            <ul class=\"thumbnails\">\r\n              <li class=\"span4\">\r\n                <div class=\"thumbnail\"><img data-src=\"holder.js/300x200\" alt=\"300x200\" style=\"width: 300px; height: 200px;\" src=\"data:image/png;base64,\">\r\n                  <div class=\"caption\">\r\n                    <h3>Thumbnail label</h3>\r\n                    <p>Cras justo odio, dapibus ac facilisis in, egestas eget quam. Donec id elit non mi porta gravida at eget metus. Nullam id dolor id nibh ultricies vehicula ut id elit.</p>\r\n                    \r\n                  </div>\r\n                </div>\r\n              </li>\r\n              <li class=\"span4\">\r\n                <div class=\"thumbnail\"><img data-src=\"holder.js/300x200\" alt=\"300x200\" style=\"width: 300px; height: 200px;\" src=\"data:image/png;base64,\">\r\n                  <div class=\"caption\">\r\n                    <h3>Thumbnail label</h3>\r\n                    <p>Cras justo odio, dapibus ac facilisis in, egestas eget quam. Donec id elit non mi porta gravida at eget metus. Nullam id dolor id nibh ultricies vehicula ut id elit.</p>\r\n                  \r\n                  </div>\r\n                </div>\r\n              </li>\r\n              <li class=\"span4\">\r\n                <div class=\"thumbnail\"><img data-src=\"holder.js/300x200\" alt=\"300x200\" style=\"width: 300px; height: 200px;\" src=\"data:image/png;base64,\">\r\n                  <div class=\"caption\">\r\n                    <h3>Thumbnail label</h3>\r\n                    <p>Cras justo odio, dapibus ac facilisis in, egestas eget quam. Donec id elit non mi porta gravida at eget metus. Nullam id dolor id nibh ultricies vehicula ut id elit.</p>\r\n                    \r\n                  </div>\r\n                </div>\r\n              </li>\r\n            </ul>\r\n          </div>\r\n\r\n          <h3>Why use thumbnails</h3>\r\n          <p>Thumbnails (previously <code>.media-grid</code> up until v1.4) are great for grids of photos or videos, image search results, retail products, portfolios, and much more. They can be links or static content.</p>\r\n\r\n          <h3>Simple, flexible markup</h3>\r\n          <p>Thumbnail markup is simple—a <code>ul</code> with any number of <code>li</code> elements is all that is required. It\'s also super flexible, allowing for any type of content with just a bit more markup to wrap your contents.</p>\r\n\r\n          <h3>Uses grid column sizes</h3>\r\n          <p>Lastly, the thumbnails component uses existing grid system classes—like <code>.span2</code> or <code>.span3</code>—for control of thumbnail dimensions.</p>\r\n\r\n          <h2>Markup</h2>\r\n          <p>As mentioned previously, the required markup for thumbnails is light and straightforward. Here\'s a look at the default setup <strong>for linked images</strong>:</p>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;ul</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"thumbnails\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  </span><span class=\"tag\">&lt;li</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"span4\"</span><span class=\"tag\">&gt;</span></li><li class=\"L2\"><span class=\"pln\">    </span><span class=\"tag\">&lt;a</span><span class=\"pln\"> </span><span class=\"atn\">href</span><span class=\"pun\">=</span><span class=\"atv\">\"#\"</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"thumbnail\"</span><span class=\"tag\">&gt;</span></li><li class=\"L3\"><span class=\"pln\">      </span><span class=\"tag\">&lt;img</span><span class=\"pln\"> </span><span class=\"atn\">data-src</span><span class=\"pun\">=</span><span class=\"atv\">\"holder.js/300x200\"</span><span class=\"pln\"> </span><span class=\"atn\">alt</span><span class=\"pun\">=</span><span class=\"atv\">\"\"</span><span class=\"tag\">&gt;</span></li><li class=\"L4\"><span class=\"pln\">    </span><span class=\"tag\">&lt;/a&gt;</span></li><li class=\"L5\"><span class=\"pln\">  </span><span class=\"tag\">&lt;/li&gt;</span></li><li class=\"L6\"><span class=\"pln\">  ...</span></li><li class=\"L7\"><span class=\"tag\">&lt;/ul&gt;</span></li></ol></pre>\r\n          <p>For custom HTML content in thumbnails, the markup changes slightly. To allow block level content anywhere, we swap the <code>&lt;a&gt;</code> for a <code>&lt;div&gt;</code> like so:</p>\r\n<pre class=\"prettyprint linenums\"><ol class=\"linenums\"><li class=\"L0\"><span class=\"tag\">&lt;ul</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"thumbnails\"</span><span class=\"tag\">&gt;</span></li><li class=\"L1\"><span class=\"pln\">  </span><span class=\"tag\">&lt;li</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"span4\"</span><span class=\"tag\">&gt;</span></li><li class=\"L2\"><span class=\"pln\">    </span><span class=\"tag\">&lt;div</span><span class=\"pln\"> </span><span class=\"atn\">class</span><span class=\"pun\">=</span><span class=\"atv\">\"thumbnail\"</span><span class=\"tag\">&gt;</span></li><li class=\"L3\"><span class=\"pln\">      </span><span class=\"tag\">&lt;img</span><span class=\"pln\"> </span><span class=\"atn\">data-src</span><span class=\"pun\">=</span><span class=\"atv\">\"holder.js/300x200\"</span><span class=\"pln\"> </span><span class=\"atn\">alt</span><span class=\"pun\">=</span><span class=\"atv\">\"\"</span><span class=\"tag\">&gt;</span></li><li class=\"L4\"><span class=\"pln\">      </span><span class=\"tag\">&lt;h3&gt;</span><span class=\"pln\">Thumbnail label</span><span class=\"tag\">&lt;/h3&gt;</span></li><li class=\"L5\"><span class=\"pln\">      </span><span class=\"tag\">&lt;p&gt;</span><span class=\"pln\">Thumbnail caption...</span><span class=\"tag\">&lt;/p&gt;</span></li><li class=\"L6\"><span class=\"pln\">    </span><span class=\"tag\">&lt;/div&gt;</span></li><li class=\"L7\"><span class=\"pln\">  </span><span class=\"tag\">&lt;/li&gt;</span></li><li class=\"L8\"><span class=\"pln\">  ...</span></li><li class=\"L9\"><span class=\"tag\">&lt;/ul&gt;</span></li></ol></pre>\r\n\r\n          <h2>More examples</h2>\r\n          <p>Explore all your options with the various grid classes available to you. You can also mix and match different sizes.</p>\r\n          <ul class=\"thumbnails\">\r\n            <li class=\"span4\">\r\n              <a href=\"#\" class=\"thumbnail\"><img data-src=\"holder.js/360x270\" alt=\"360x270\" style=\"width: 360px; height: 270px;\" src=\"data:image/png;base64,\"></a>\r\n            </li>\r\n            <li class=\"span3\">\r\n              <a href=\"#\" class=\"thumbnail\"><img data-src=\"holder.js/260x120\" alt=\"260x120\" style=\"width: 260px; height: 120px;\" src=\"data:image/png;base64,\"></a>\r\n            </li>\r\n            <li class=\"span2\">\r\n              <a href=\"#\" class=\"thumbnail\"><img data-src=\"holder.js/160x120\" alt=\"160x120\" style=\"width: 160px; height: 120px;\" src=\"data:image/png;base64,\"></a>\r\n            </li>\r\n            <li class=\"span3\">\r\n              <a href=\"#\" class=\"thumbnail\"><img data-src=\"holder.js/260x120\" alt=\"260x120\" style=\"width: 260px; height: 120px;\" src=\"data:image/png;base64,\"></a>\r\n            </li>\r\n            <li class=\"span2\">\r\n              <a href=\"#\" class=\"thumbnail\"><img data-src=\"holder.js/160x120\" alt=\"160x120\" style=\"width: 160px; height: 120px;\" src=\"data:image/png;base64,\"></a>\r\n            </li>\r\n          </ul>','','full_html'),('node','page',0,59,59,'und',0,'          <p>Use any button to trigger a dropdown menu by placing it within a <code>.btn-group</code> and providing the proper menu markup.</p>\r\n          <div class=\"bs-docs-example\">\r\n            <div class=\"btn-toolbar\" style=\"margin: 0;\">\r\n              <div class=\"btn-group\">\r\n                <button class=\"btn dropdown-toggle\" data-toggle=\"dropdown\">Action <span class=\"caret\"></span></button>\r\n                <ul class=\"dropdown-menu\">\r\n                  <li><a href=\"#\">Actio