ion.</p>\r\n          <p>In some cases—like mobile—dropdown menus will extend outside the viewport. You need to resolve the alignment manually or with custom JavaScript.</p>\r\n\r\n\r\n          <hr class=\"bs-docs-separator\">\r\n\r\n\r\n          <h2>Split button dropdowns</h2>\r\n          <p>Building on the button group styles and markup, we can easily create a split button. Split buttons feature a standard action on the left and a dropdown toggle on the right with contextual links.</p>\r\n          <div class=\"bs-docs-example\">\r\n            <div class=\"btn-toolbar\" style=\"margin: 0;\">\r\n              <div class=\"btn-group\">\r\n                <button class=\"btn\">Action</button><button class=\"btn dropdown-toggle\" data-toggle=\"dropdown\"><span class=\"caret\"></span></button>\r\n                <ul class=\"dropdown-menu\">\r\n                  <li><a href=\"#\">Action</a></li>\r\n                  <li><a href=\"#\">Another action</a></li>\r\n                  <li><a href=\"#\">Something else here</a></li>\r\n                  <li class=\"divider\"></li>\r\n                  <li><a href=\"#\">Separated link</a></li>\r\n                </ul>\r\n              </div><!-- /btn-group -->\r\n              <div class=\"btn-group\">\r\n                <button class=\"btn btn-primary\">Action</button><button class=\"btn btn-primary dropdown-toggle\" data-toggle=\"dropdown\"><span class=\"caret\"></span></button>\r\n                <ul class=\"dropdown-menu\">\r\n                  <li><a href=\"#\">Action</a></li>\r\n                  <li><a href=\"#\">Another action</a></li>\r\n                  <li><a href=\"#\">Something else here</a></li>\r\n                  <li class=\"divider\"></li>\r\n                  <li><a href=\"#\">Separated link</a></li>\r\n                </ul>\r\n              </div><!-- /btn-group -->\r\n              <div class=\"btn-group\">\r\n                <button class=\"btn btn-danger\">Danger</button><button class=\"btn btn-danger 